function getUpperAndLowerC(a, b)
    upperC = cbrt(sqrt((BigInt(a)^6-BigInt(b)^6)))
    lowerC = cbrt(sqrt((BigInt(a)^6-BigInt(b)^6)/(4^6)))
    return upperC, lowerC
end

function getUpperAndLowerD(a, b, c)
    upperD = cbrt(sqrt((BigInt(a)^6-BigInt(b)^6-BigInt(c)^6)))
    lowerD = cbrt(sqrt((BigInt(a)^6-BigInt(b)^6-BigInt(c)^6)/(3^6)))
    return upperD, lowerD
end

function getUpperAndLowerE(a, b, c, d)
    upperE = cbrt(sqrt((BigInt(a)^6-BigInt(b)^6-BigInt(c)^6-BigInt(d))))
    lowerE = cbrt(sqrt((BigInt(a)^6-BigInt(b)^6-BigInt(c)^6-BigInt(d))/(2^6)))
    return upperE, lowerE
end

function getUpperF(a,b,c,d,e)
    upperF = cbrt(sqrt((BigInt(a)^6-BigInt(b)^6-BigInt(c)^6-BigInt(d)-BigInt(e))))
    return upperF
end

function getModOf6Power(base,modNum)
    return mod(BigInt(base)^6, modNum)
end

function getLeftModSubIn3Numbers(prime, a, b, c)
    result = getModOf6Power(a, prime) - getModOf6Power(b, prime) - getModOf6Power(c, prime);
    while (result < 0)
        result += prime;
    end
    return result;
end

function getLeftModSubIn2Numbers(prime, a, b, c, d)
    result = getModOf6Power(a, prime) - getModOf6Power(b, prime) - getModOf6Power(c, prime) - getModOf6Power(d, prime);
    while result < 0
        result += prime
    end
    return result
end

function getLeftModSubIn1Numbers(prime, a, b, c, d, e)
    result = getModOf6Power(a, prime) - getModOf6Power(b, prime) - getModOf6Power(c, prime) - getModOf6Power(d, prime) - getModOf6Power(e, prime)
    while result < 0
        result += prime
    end
    return result
end

